function LoadData(){$.ajax({url:"/Orders/GetOrders",type:"POST",data:$("form").serialize(),headers:{RequestVerificationToken:$('input:hidden[name="__RequestVerificationToken"]').val()},success:function(n){var t=n,u,r,i;if(console.log("response",t),t.responseCode==CODES.RESPONSE_CODE_OK)for(u=$("#sales-report-table").DataTable(),r=0;r<t.model.length;r++)i=t.model[r],u.row.add([i.id,i.orderNo,i.status,i.createdOn,i.modifiedOn,]).draw(!1);else t.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:t.errorMessage}):t.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:t.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while loading Orders."})}})}function PrintReceipt(n){n!=null&&$.ajax({url:"/Orders/PrintReceipt/"+n,type:"GET",success:function(n){var t=n;t.responseCode==CODES.RESPONSE_CODE_OK?sweetAlert.success({title:"Printed!",text:t.responseMessage}):t.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:t.errorMessage}):t.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:t.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while Printing Receipt."})}})}